import React from 'react'
import './filters.css'

function Filters() {
    let mArr = [
        'All', 'Artificial Intelligence', 'cloud Computing'
        , 'DevOps', 'Programming Languages', 'Mobile Application Developmemt'
        , 'Technology and Tools', 'Get a Job in a Tech Company', 'Others'
    ];

    const filterComponent = (filterData) => <a className="filter-data">{filterData}</a>

    return(

        <div id="filter-container">

        <div>
        <img id="filter-icon" alt="filter-icon" src="data:image/png;base64," />
        <p id="fbc">Filter by Category</p>
        </div>

        {mArr.map((item) => filterComponent(item))}
        
        {/* <p>{mArr[8]}</p> */}

        </div>

    );
}

export default Filters;